    [],nt"revision_timestamp": "2016-07-27T22:42:21.523414",nt"name": "squaw-creek-national-wildlife-refuge-contaminant-survey-results",nt"isopen":
    false,nt"url": null,nt"notes": "As part of a baseline contaminant survey
    of all National Wildlife Refuges (NWR) in Missouri, fish were collected at the Squaw
    Creek NWR from Davis and Squaw creeks in August, 1987. Standard metals and organochlorine
    scans were completed on these samples. The results were compared to the nationwide
    geometric mean for each metal and organochlorine, as established by the U.S. Fish
    and Wildlife Service's (Service) database, the National Contaminant Biomonitoring
    Program. Individual samples were found to have levels of arsenic, cadmium, copper,
    lead, mercury, selenium, zinc, or dieldrin greater than the national average. Arsenic,
    cadmium, and zinc were highly elevated. A follow-up study is recommended with emphasis
    on these three metals. A common link among these three contaminants is lead. Lead
    is associated with arsenic, cadmium, and zinc in the form of dry or wet cell batteries,
    and/or in refining or recycling of lead. A battery recycling plant located near
    Squaw Creek NWR has been a source of local controversy in recent years. Therefore,
    lead should be emphasized in a follow-up study as well. Should elevated levels of
    these metals be detected in the follow-up study, an intensive, detailed investigation
    is warranted to determine whether the contaminants are moving through the food chain
    and affecting Service trust resources. Since the primary purpose of the refuge relates
    to avian species, with emphasis on endangered species, waterfowl and shorebirds,
    measures should be taken to protect these resources consistent with further findings.",nt"license_title":
